Mantan kepala SMPN 17 Tangerang Selatan Marhaen Nusantara ditetapkan sebagau tersangka kasus dugaan korupsi dana Program Indonesia Pintar (PIP).

&quot;Bahwa pada hari ini, Senin tanggal 11 Juli 2022 telah dilakukan penetapan tersangka kepada Marhaen Nusantara,&quot; ujar Kepala Kejaksaan Negeri Tangsel Aliansyah di Kantor Kejari Tangsel, Senin (11/7/2022).

Marhaen juga ditahan selama 20 hari di Lembaga Pemasyarakatan (Lapas) Pemuda Kelas II A Tangerang.

Aliansyah menjelaskan, pada tahun Anggaran 2020, Kementerian Pendidikan dan Kebudayaan (Kemendikbud) memberikan Program Indonesia Pintar (PIP) pada SMPN 17 Tangerang Selatan yang dananya bersumber dari DIPA Pusat Layanan Pembiayaan Pendidikan (Puslapdik) Tahun Anggaran 2020 Nomor DIPA-023.01.1.690399/2020.

Penerimaan dana PIP ditetapkan sesuai dengan Surat Keputusan Kepala Pusat Layanan Pembiayaan Pendidikan Nomor 8/J5.1.2/BP/SK.5/2020 tentang Pemberian Program Indonesia Pintar (PIP) Sekolah Menengah Pertama Tahap V Tahun Anggaran 2020 tanggal 13 Juli 2020.

Pada tahap V, jumlah penerima merupakan usulan pemangku kepentingan sebanyak 1.109 siswa dengan nilai nominal Rp 724.875.000,00.

&quot;Bahwa jumlah penerima PIP di SMPN 17 Tangerang Selatan tahun 2020 sebanyak 1.218 siswa. Sebanyak 1.109 Siswa dari 1.218 Siswa merupakan usulan pemangku kepentingan,&quot; jelas Aliansyah.

Kemudian, Marhaen melakukan aktivasi dan menarik dana secara kolektif di Bank Rakyat Indonesia KCP Indah Mas Balaraja sebanyak 1.077 siswa dengan total Rp 699 juta.

Penarikan dana dilakukan sebanyak 11 kali. Namun, Marhaen mencairkan dana tersebut secara ilegal.

&quot;Marhaen selaku Kepala Sekolah SMP Negeri 17 Kota Tangerang Selatan tidak pernah menerima surat kuasa dari orangtua siswa penerima,&quot; kata Aliansyah.

Perbuatan Marhaen Nusantara dianggap bertentangan dengan Permendikbud Nomor 10 Tahun 2020 tentang Program Indonesia Pintar juncto Lampiran I Persesjen Kemendikbud Nomor 8 Tahun 2020 tentang Petunjuk Pelaksanaan Program Indonesia Pintar yang mengakibatkan kerugian negara senilai Rp 699 juta.

Kejari telah memeriksa beberapa saksi dan juga menyita barang bukti berupa dokumen-dokumen terkait kasus.

Akibat perbuatannya, Marhaen dijerat Pasal 2 Ayat (1) Undang-Undang Nomor 20 Tahun 2001, tentang Perubahan atas Undang-Undang Nomor 31 Tahun 1999, tentang Pemberantasan Tindak Pidana Korupsi; Pasal 3 Undang Undang Nomor 20 Tahun 2001, tentang Perubahan atas Undang-Undang Nomor 31 Tahun 1999, tentang Pemberantasan Tindak Pidana Korupsi. Dan Pasal 8 Undang Undang Nomor 20 Tahun 2001, tentang Perubahan atas Undang-Undang Nomor 31 Tahun 1999 tentang Pemberantasan Tindak Pidana.â€¬" data-testid="last-msg-status"><span dir="auto" class="l7jjieqr i0jNr">+62 823-1988-8249</span><span>:&nbsp;</span><span dir="ltr" class="ggj6brxn gfz4du6o r7fjleex g0rxnol2 lhj4utae le5p0ye3 l7jjieqr i0jNr">Mantan Kepala Sekolah SMPN 17 Tangsel Jadi Tersangka Kasus Korupsi Dana PIP

Mantan kepala SMPN 17 Tangerang Selatan Marhaen Nusantara ditetapkan sebagau tersangka kasus dugaan korupsi dana Program Indonesia Pintar (PIP).

"Bahwa pada hari ini, Senin tanggal 11 Juli 2022 telah dilakukan penetapan tersangka kepada Marhaen Nusantara," ujar Kepala Kejaksaan Negeri Tangsel Aliansyah di Kantor Kejari Tangsel, Senin (11/7/2022).

Marhaen juga ditahan selama 20 hari di Lembaga Pemasyarakatan (Lapas) Pemuda Kelas II A Tangerang.

Aliansyah menjelaskan, pada tahun Anggaran 2020, Kementerian Pendidikan dan Kebudayaan (Kemendikbud) memberikan Program Indonesia Pintar (PIP) pada SMPN 17 Tangerang Selatan yang dananya bersumber dari DIPA Pusat Layanan Pembiayaan Pendidikan (Puslapdik) Tahun Anggaran 2020 Nomor DIPA-023.01.1.690399/2020.

Penerimaan dana PIP ditetapkan sesuai dengan Surat Keputusan Kepala Pusat Layanan Pembiayaan Pendidikan Nomor 8/J5.1.2/BP/SK.5/2020 tentang Pemberian Program Indonesia Pintar (PIP) Sekolah Menengah Pertama Tahap V Tahun Anggaran 2020 tanggal 13 Juli 2020.

Pada tahap V, jumlah penerima merupakan usulan pemangku kepentingan sebanyak 1.109 siswa dengan nilai nominal Rp 724.875.000,00.

"Bahwa jumlah penerima PIP di SMPN 17 Tangerang Selatan tahun 2020 sebanyak 1.218 siswa. Sebanyak 1.109 Siswa dari 1.218 Siswa merupakan usulan pemangku kepentingan," jelas Aliansyah.

Kemudian, Marhaen melakukan aktivasi dan menarik dana <span class="matched-text i0jNr">sec</span>ara kolektif di Bank Rakyat Indonesia KCP Indah Mas Balaraja sebanyak 1.077 siswa dengan total Rp 699 juta.

Penarikan dana dilakukan sebanyak 11 kali. Namun, Marhaen mencairkan dana tersebut <span class="matched-text i0jNr">sec</span>ara ilegal.

"Marhaen selaku Kepala Sekolah SMP Negeri 17 Kota Tangerang Selatan tidak pernah menerima surat kuasa dari orangtua siswa penerima," kata Aliansyah.

Perbuatan Marhaen Nusantara dianggap bertentangan dengan Permendikbud Nomor 10 Tahun 2020 tentang Program Indonesia Pintar juncto Lampiran I Persesjen Kemendikbud Nomor 8 Tahun 2020 tentang Petunjuk Pelaksanaan Program Indonesia Pintar yang mengakibatkan kerugian negara senilai Rp 699 juta.

Kejari telah memeriksa beberapa saksi dan juga menyita barang bukti berupa dokumen-dokumen terkait kasus.

Akibat perbuatannya, Marhaen dijerat Pasal 2 Ayat (1) Undang-Undang Nomor 20 Tahun 2001, tentang Perubahan atas Undang-Undang Nomor 31 Tahun 1999, tentang Pemberantasan Tindak Pidana Korupsi; Pasal 3 Undang Undang Nomor 20 Tahun 2001, tentang Perubahan atas Undang-Undang Nomor 31 Tahun 1999, tentang Pemberantasan Tindak Pidana Korupsi. Dan Pasal 8 Undang Undang Nomor 20 Tahun 2001, tentang Perubahan atas Undang-Undang Nomor 31 Tahun 1999 tentang Pemberantasan Tindak Pidana.</span></span></div><div role="gridcell" aria-colindex="1" class="_1i_wG"><span></span><span></span></div></div></div></div></div></div><div class="lhggkp7q ln8gz9je rx9719la" style="z-index: 5; transition: none 0s ease 0s; height: 72px; transform: translateY(360px);"><div tabindex="-1"><div data-testid="cell-frame-container" class="_2nY6U vq6sj _7qwtH"><div class="_2EU3r"></div><div class="_3OvU8"><div role="gridcell" aria-colindex="2" class="_3vPI2"><div class="zoWT4"><span dir="auto" title="dalgona dan basreng" class="ggj6brxn gfz4du6o r7fjleex g0rxnol2 lhj4utae le5p0ye3 l7jjieqr i0jNr">dalgona dan basreng</span></div><div class="_1i_wG">12/9/2022</div></div><div class="_37FrU"><div class="_1qB8f"><span class="Hy9nV" title="â€ªsecret ie mhâ€¬" data-testid="last-msg-status"><span dir="auto" class="l7jjieqr i0jNr">dewi</span><span>:&nbsp;</span><span dir="ltr" class="ggj6brxn gfz4du6o r7fjleex g0rxnol2 lhj4utae le5p0ye3 l7jjieqr i0jNr"><span class="matched-text i0jNr">sec</span>ret ie mh</span></span></div><div role="gridcell" aria-colindex="1" class="_1i_wG"><span></span><span></span></div></div></div></div></div></div><div class="lhggkp7q ln8gz9je rx9719la" style="z-index: 4; transition: none 0s ease 0s; height: 72px; transform: translateY(288px);"><div tabindex="-1"><div data-testid="cell-frame-container" class="_2nY6U vq6sj _7qwtH"><div class="_2EU3r"></div><div class="_3OvU8"><div role="gridcell" aria-colindex="2" class="_3vPI2"><div class="zoWT4"><span dir="auto" title="Silpaaa" class="ggj6